import { ValuesType } from "types/types";
import st from "./Check.module.scss";

interface Props {
  values: ValuesType;
}

export const Check = ({ values }: Props) => {
  console.log(values);

  return (
    <div className={st.check_container}>
      <div>
        <div className={st.label}>Lastname</div>
        <div className={st.value}>{values.lastname}</div>
      </div>
      <div>
        <div className={st.label}>Firstname</div>
        <div className={st.value}>{values.firstname}</div>
      </div>
      <div>
        <div className={st.label}>Birth</div>
        <div className={st.value}>
          {values.birth.month}-{values.birth.date}-{values.birth.year}
        </div>
      </div>
      <div>
        <div className={st.label}>Gender</div>
        <div className={st.value}>{values.gender}</div>
      </div>
      <div>
        <div className={st.label}>Email</div>
        <div className={st.value}>{values.email}</div>
      </div>
      <div>
        <div className={st.label}>Id</div>
        <div className={st.value}>{values.id.id}</div>
      </div>
      <div>
        <div className={st.label}>Pw</div>
        <div className={st.value}>{values.id.pw}</div>
      </div>
    </div>
  );
};

export default Check;
